/// This function demonstrates how TreeSync could be used to manage a tree and could be
/// used in create_commit to create a provisional tree and the
/// corresponding values (tree_hash, commit_secret, etc).
/// It returns the diff resulting from the operations applied to the TreeSync instance,
/// as well as the vector of `NodeSeed`s that can then be encrypted using TreeKEM.
/// Note, that the application with apply_commit is slightly asymmetrical, as we would potentially have
/// to pass in an additional `path` for TreeSync to apply.
fn apply_proposals(&self, key_store: &KeyStore, proposal_list: Vec<Proposal>) -> Result<(TreeSyncDiff), ApplyProposalsError>{ // ... // as Proposals are not generic, we have to translate them // individually to TreeSync operations // the assumption here is that the list of proposals is already // ordered by type and order as per commit let mut path_required = false; let mut my_new_key_package = None; let mut diff = self.tree_sync.empty_diff(); for proposal in &proposal_list { match proposal { Update(key_package) => { // If we process an update, we need to include a path in the end path_required = true; // We process self updates later using the update_path function if key_package.identity() != &self.identity { diff.update_leaf(key_package.into()) } else { my_new_key_package = Some(key_package) } }, Add(key_package) => diff.add(TreeSyncNode::from(key_package)), // It's not clear yet how to expose "identity" to TreeSync. Remove(leaf_index) => { // If we process a remove, we need to include a path in the end path_required = true; diff.remove(leaf_index), } }; } // If we want to create a path and/or one of the updates was a // self-update. if path_required || my_new_key_package.is_some() { // a path is required, but there's no explicit update, generate a new key_package if my_new_key_package.is_none() { my_new_key_package = key_store.generate_key_package_bundle(...); } // We assume that this function gives us the path based on the leaf_secret of the // key package bundle, which is in the key store. let (path, path_secrets) = create_path(&key_store, &my_new_key_package)?; // The private values generated in the process are put into the key store // This will compute the path secret and set it in the new leaf node. diff.update_path(TreeSyncLeafNode(my_new_key_package.unwrap()), path)?; } else { diff } // We can now call TreeKEM and encrypt the `path_secrets` (see below).
}

